import React from "react";

class Cars extends React.Component {
  state = {
    cars: [
      {
        make: "Kia",
        model: "Sorento",
        year: 2020,
      },
      {
        make: "Kia",
        model: "Optima",
        year: 2019,
      },
      {
        make: "Tesla",
        model: "Model 3",
        year: 2021,
      },
      {
        make: "Honda",
        model: "Civic",
        year: 2019,
      },
      {
        make: "Honda",
        model: "Accord",
        year: 2018,
      },
      {
        make: "Volkswagen",
        model: "Jetta",
        year: 2021,
      },
      {
        make: "Toyota",
        model: "Camry",
        year: 2021,
      },
      {
        make: "Ford",
        model: "Mustang",
        year: 2019,
      },
      {
        make: "Ford",
        model: "F-150",
        year: 2019,
      },
      {
        make: "Toyota",
        model: "Camry",
        year: 2020,
      },
      {
        make: "Ford",
        model: "F-150",
        year: 2021,
      },
    ],
  };
  mapCar = (oneCar) => {
    var result = oneCar.make;
    return result;
  };
  render() {
    return (
      <div className="col-md-12 p-5">
        <h1> Cars </h1>
        <div className="card col-md-3 m-1">
          <div className="card-body">
            <h5 className="card-title">
              {this.state.cars.map(this.mapCar)}Make
            </h5>
            <h5 className="card-text">Model</h5>
            <h5 className="card-text">Year</h5>
          </div>
        </div>
      </div>
    );
  }
}
export default Cars;
